import React from 'react'
import Banner from 'react-banner'
import './banner.css'
import "./markets.js";

export default props => {
    return (
        <Banner
            logo="GrafiTTraders"
            url={ window.location.pathname }
            links={[
                 {"title": "Markets", "url":"Markets" },
                { "title": "Grafits", "url": "Grafits" },
                { "title": "Suport", "url": "/suport" }
            ]} />
    )
}
